import styled from "styled-components";

const Wrapper = styled.section`
  max-width: var(--max-width);
  margin: 14rem auto 5rem auto;
  margin-top: 14rem;

  .content {
    max-width: var(--max-width-content);
    margin: 0 auto;

    .flex_{
        display: flex;
        align-items: center;
        gap: 1.6rem;
        .rectangle{
            width: 20px;
            height: 40px;
        }
    }

  }
`;

export default Wrapper;
